import React, { useCallback, useMemo, useState } from 'react'
import Todo from './Todo';

const Test = () => {
    const expensiveCalculation = (num) => {
        console.log("Calculating...");
        for (let i = 0; i < 1000000000; i++) {
          num += 1;
        }
        return num;
      };

    const [data,setData]=useState(0);
    const [list, setList]=useState([]);
    const calculation = expensiveCalculation(data);

    useMemo
    const incrementVal=()=>{
        setData(()=>{
            return data+1;
        })
    }

    const addList = useCallback(()=>{
        setList((preVal)=>[...preVal,'new entry']);
    },[list]);



  return (
    <React.Fragment>
        <Todo data={list} addTodo={addList}/>
        <p>{calculation}</p>
        {data}
        <button onClick={incrementVal}>click here</button>
    </React.Fragment>
  )
}

export default Test
